"use strict";

var _routed_link = require("./routed_link");

describe('manager.ui.containers.routed_link', function () {
  describe('mapper', function () {
    test('should give correct data', function () {
      var state = {
        shortcutOptions: {}
      };
      var props = {
        overrideParams: {
          selectedKind: 'kind',
          selectedStory: 'story'
        }
      };

      var _mapper = (0, _routed_link.mapper)(state, props),
          href = _mapper.href;

      expect(href).toContain('selectedKind=kind');
      expect(href).toContain('selectedStory=story');
    });
  });
});